import React from "react";
function Fun(){
    // const a=["apple","mango","kiwi"]
    return(
        <div classname="HtmlComponents">
        <form action='./test.html'>
        <label>Enter</label>
        <input type="text"/>
        <input type="submit" value="submit"/>
        </form>
        <Fun />
        </div>

    )
        
}
export default Fun;
